search.style.css:
.select-wrap {
    padding: 0 0 10px 0;
    font-family: Roboto;
    padding: 1em;
}

.select-wrap input {
    height: 28px;
    width: 100%;
    border-width: 0 0 2px 0;
    background: transparent;
}

.select-wrap input:focus {
    border-bottom-style: solid;
    border-color: #ff4081;
}

.select-wrap input {
    outline: none;
    font-size: 14px;
    padding: .2em;
    height: 30px;
}

@media (min-width: 480px) and (max-width:639px) {
    .select-wrap input {
        width: 40%
    }
}

@media (min-width:640px) {
    .select-wrap input {
        width: 25%
    }
}

